import './App.css';
import Home from './home';
import { ParallaxProvider } from 'react-scroll-parallax';

function App() {
  return (
    
    <div className="App">
      <ParallaxProvider>
      <Home /></ParallaxProvider>
    </div>
  );
}

export default App;
